    const handleSearch = (query) => {
        console.log('Searching for:', query); // Handle search logic here
    };

    return (
        <div className="BOT">        
            <SearchBar onSearch={handleSearch} />
            <ChatIcon />
        </div>
    );
}

// for logo at the left uppermost corner of the webpage
function Bap() {
    return (
        <div className="app-container">
            <img src="/logo.png" alt="Logo" className="logo" /> {/* Update the path accordingly */}
            <ChatIcon />
        </div>
    );
}
export default App;
